import React, { useState, useEffect } from "react";
import axios from "axios";
import { Image, Project } from "./types/interfaces"

const ProjectSection: React.FC = () => {
    const [projects, setProjects] = useState<Project[]>([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        axios
            .get('http://localhost:5000/api/projects/loadprojects') // Dev Endpoint
            //.get('https://official-projects.onrender.com/api/projects/loadprojects')
            .then(res => setProjects(res.data))
    })



    return <div> View my projects below! </div>



}

export default ProjectSection;
